import React from 'react';
import "./exercises.css";
import $ from 'jquery'
import childExercise from "../../containers/ChildExercise";
import ChildExercise from "../../containers/ChildExercise";

const Exercises = (props) => {
    // <div>
    //     <div className="col">
    //         <div className="card shadow-sm">
    //             <svg className="bd-placeholder-img card-img-top" width="100%" height="225"
    //                  xmlns="http://www.w3.org/2000/svg" role="img" aria-label="Placeholder: Thumbnail"
    //                  preserveAspectRatio="xMidYMid slice" focusable="false"><title>{props.Name}</title>
    //                 <rect width="100%" height="100%" fill="#55595c"/>
    //                 <text x="50%" y="50%" fill="#eceeef" dy=".3em">Thumbnail</text>
    //             </svg>
    //
    //             <div className="card-body">
    //                 <p className="card-text">{props.Description}</p>
    //                 <div className="d-flex justify-content-between align-items-center">
    //                     <div className="btn-group">
    //                         <button type="button" className="btn btn-sm btn-outline-secondary">View
    //                         </button>
    //                         <button type="button" className="btn btn-sm btn-outline-secondary">Add to Workout
    //                         </button>
    //                     </div>
    //                     <small className="text-muted">9 mins</small>
    //                 </div>
    //             </div>
    //         </div>
    //     </div>
    // </div>
    
    
    const AddExercise = (props) => {
        const whereTo = $('#insert-child')
        console.log(whereTo + "ss")
        const title = props.Title
        const description = "A brief description of the exercise."
        
        
        let firstDiv = document.createElement("div")
        
        let secondDiv = document.createElement("div")
        secondDiv.className = "col";
        
        let thirdDiv = document.createElement("div")
        thirdDiv.className = "card shadow-sm"
        
        whereTo.append(firstDiv)
        
    }

    const data = props.props[0]
    data.forEach(exercise=> AddExercise(exercise))
    // data.forEach(exercise=> console.log(exercise))

    return (<main className="tampit">
        <section className="py-5 text-center container">
            <div className="row py-lg-5">
                <div className="col-lg-6 col-md-8 mx-auto">
                    <h1 className="fw-light">Album example</h1>
                    <p className="lead text-muted">Something short and leading about the collection below—its
                        contents, the creator, etc. Make it short and sweet, but not too short so folks don’t simply
                        skip over it entirely.</p>
                </div>
            </div>
        </section>


        <div className="album py-5 bg-light">
            <div className="container">

                <div className="row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3" id="insert-child">
                    <div>
                        <div className="col">
                            <div className="card shadow-sm">
                                <svg className="bd-placeholder-img card-img-top" width="100%" height="225"
                                     xmlns="http://www.w3.org/2000/svg" role="img" aria-label="Placeholder: Thumbnail"
                                     preserveAspectRatio="xMidYMid slice" focusable="false"><title>{props.Name}</title>
                                    <rect width="100%" height="100%" fill="#55595c"/>
                                    <text x="50%" y="50%" fill="#eceeef" dy=".3em">Thumbnail</text>
                                </svg>

                                <div className="card-body">
                                    <p className="card-text">{props.Description}</p>
                                    <div className="d-flex justify-content-between align-items-center">
                                        <div className="btn-group">
                                            <button type="button" className="btn btn-sm btn-outline-secondary">View
                                            </button>
                                            <button type="button" className="btn btn-sm btn-outline-secondary">Add to Workout
                                            </button>
                                        </div>
                                        <small className="text-muted">9 mins</small>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>

    </main>);
};

export default Exercises;
